import React, {useEffect, useState} from 'react';

const Main = () => {

    const[list , setList] = useState([])

    useEffect(() => {
      fetch('http://localhost:3000/')
        .then(response => response.json())
        .then(data => setList(data))
        .catch(error => console.error('Error fetching data:', error));
    }, []);

    return(
        {list}
    )
    
    
}
    
    
export default Main;
